import React from 'react'
import { Page, Text, View, Document, StyleSheet, ReactPDF, PDFDownloadLink } from '@react-pdf/renderer';
import { Table } from 'antd';


const dataSource = [
    {
        key: '1',
        name: '胡彦斌',
        age: 32,
        address: '西湖区湖底公园1号',
    },
    {
        key: '2',
        name: '胡彦祖',
        age: 42,
        address: '西湖区湖底公园1号',
    },
];

const columns = [
    {
        title: '姓名',
        dataIndex: 'name',
        key: 'name',
    },
    {
        title: '年龄',
        dataIndex: 'age',
        key: 'age',
    },
    {
        title: '住址',
        dataIndex: 'address',
        key: 'address',
    },
];

const Testpage1 = () => {

    const styles = StyleSheet.create({
        page: { flexDirection: "column", padding: 25 },
        table: {
          fontSize: 10,
          width: 550,
          display: "flex",
          flexDirection: "column",
          justifyContent: "flex-start",
          alignContent: "stretch",
          flexWrap: "nowrap",
          alignItems: "stretch"
        },
        row: {
          display: "flex",
          flexDirection: "row",
          justifyContent: "space-around",
          alignContent: "stretch",
          flexWrap: "nowrap",
          alignItems: "stretch",
          flexGrow: 0,
          flexShrink: 0,
          flexBasis: 35
        },
        cell: {
          borderColor: "#cc0000",
          borderStyle: "solid",
          borderWidth: 2,
          flexGrow: 1,
          flexShrink: 1,
          flexBasis: "auto",
          alignSelf: "stretch"
        },
        header: {
          backgroundColor: "#eee"
        },
        headerText: {
          fontSize: 11,
          fontWeight: 1200,
          color: "#1a245c",
          margin: 8
        },
        tableText: {
          margin: 10,
          fontSize: 10,
          color: 'black'
        }
      });

    // Create Document Component
    const MyDocument = () => (
        <Document>
            <Page style={styles.page} size="A4" wrap>
                <View style={styles.table}>
                    <View style={[styles.row, styles.header]}>
                        <Text style={[styles.headerText, styles.cell]}>Column 1 Header</Text>
                        <Text style={[styles.headerText, styles.cell]}>Column 2 Header</Text>
                        <Text style={[styles.headerText, styles.cell]}>Column 3 Header</Text>
                        <Text style={[styles.headerText, styles.cell]}>Column 4 Header</Text>
                    </View>
                </View>
                <View style={styles.table}>
                    <View style={[styles.row, styles.header]}>
                        <Text style={[styles.headerText, styles.cell]}>Column 1 Header</Text>
                        <Text style={[styles.headerText, styles.cell]}>Column 2 Header</Text>
                        <Text style={[styles.headerText, styles.cell]}>Column 3 Header</Text>
                        <Text style={[styles.headerText, styles.cell]}>Column 4 Header</Text>
                    </View>
                </View>
            </Page>
        </Document>
    );




    return (
        <div>
            <PDFDownloadLink document={<MyDocument />} fileName="somename.pdf">
                {({ blob, url, loading, error }) =>
                    loading ? 'Loading document...' : 'Download now!'
                }
            </PDFDownloadLink>
        </div>
    )
}

export default Testpage1
